# Importiere die notwendigen Bibliotheken
import pandas as pd
import json
from geojson import Point, Feature, FeatureCollection, dump

# --- 1. SETUP & ANPASSUNG AN DEINE SPALTEN ---

# a) Liste der "statischen" Eigenschaften, die du übernehmen willst.
statische_spalten = [
    'Betreiber',
    'Anzeigename (Karte)',
    'Status',
    'Anzahl Ladepunkte',
    'Nennleistung Max',
    'Inbetriebnahmedatum',
    'Straße',
    'Hausnummer',
    'Postleitzahl',
    'Ort',
    'Bundesland',
    'Öffnungszeiten',
    'Steckertypen1',
    'Nennleistung Stecker1',
    'Steckertypen2',
    'Nennleistung Stecker2',
    'Steckertypen3',
    'Nennleistung Stecker3',
    'Steckertypen4',
    'Nennleistung Stecker4'
]

# b) Liste der von dir erstellten Kategorie-Spalten.
kategorie_spalten = [
    'Restaurants', 'Cafes', 'Fast Food', 'Arts Centre', 'BBQ',
    'Biergarten', 'Cinema', 'Library', 'Marketplace', 'Nightclub',
    'Place_of_worship', 'Pub', 'Vending_Machine', 'Food_Court',
    'Tourism_information', 'Museum', 'Ice Cream'
]

# Dateipfade für Checkpoint und finale Dateien
drive_pfad = '/content/drive/MyDrive/fortschritt_ice cream' # BITTE ANPASSEN
checkpoint_datei = drive_pfad + 'checkpoint_features.json'
finale_geojson_datei = drive_pfad + 'alle_schnelllader_mit_umfeld.geojson'
fehler_log_datei = drive_pfad + 'fehler_log.json'

# Lade Checkpoint-Daten, falls vorhanden
try:
    with open(checkpoint_datei, 'r') as f:
        features = json.load(f)
    print(f"Checkpoint-Datei gefunden. {len(features)} Features wurden bereits verarbeitet.")
except FileNotFoundError:
    print("Keine Checkpoint-Datei gefunden. Starte bei null.")
    features = []

# Initialisiere eine leere Liste für die fehlerhaften Zeilen
fehlerhafte_zeilen = []

start_index = len(features)
print(f"Starte die Feature-Erstellung ab Index: {start_index}")


# --- 2. HAUPTPROZESS: FEATURES ERSTELLEN ---

if start_index < len(chargers_fast):
    try:
        for indice, row in chargers_fast.iloc[start_index:].iterrows():
            try:
                # --- HIER BEGINNT DIE EINGEFÜGTE LOGIK ---

                # a) Adresse aus mehreren Spalten zusammensetzen
                addresse = f"{row.get('Straße', '')} {str(row.get('Hausnummer', '')).split('.')[0]}, {str(row.get('Postleitzahl', '')).split('.')[0]} {row.get('Ort', '')}".strip().replace(" ,", ",")

                # b) Eine Liste aller vorhandenen und einzigartigen Steckertypen erstellen
                stecker_liste_mit_duplikaten = []
                for i in range(1, 5): # Geht von Steckertypen1 bis Steckertypen4
                    stecker_typ = row.get(f'Steckertypen{i}')
                    if pd.notna(stecker_typ) and str(stecker_typ).strip() != '':
                        stecker_liste_mit_duplikaten.append(str(stecker_typ))
                einzigartige_stecker_liste = list(set(stecker_liste_mit_duplikaten))

                # c) Das verschachtelte "amenities"-Objekt erstellen
                amenities_objekt = {}
                for kategorie in kategorie_spalten:
                    key = kategorie.lower().replace(' ', '_')
                    amenities_objekt[key] = int(row.get(kategorie, 0))

                # d) Das finale "properties"-Wörterbuch nach Vorlage zusammensetzen
                eigenschaften = {
                    "betreiber": row.get('Betreiber', ''),
                    "addresse": addresse,
                    "max_kw": int(row.get('Nennleistung Max', 0)),
                    "anzahl_lps": int(row.get('Anzahl Ladepunkte', 0)),
                    "stecker": einzigartige_stecker_liste,
                    "inbetriebnahmedatum": str(row.get('Inbetriebnahmedatum', ''))[:10],
                    "amenities": amenities_objekt
                }

                # --- ENDE DER EINGEFÜGTEN LOGIK ---

                # Geometrie erstellen
                point = Point((row["Längengrad"], row["Breitengrad"]))

                # Feature erstellen und hinzufügen
                feature = Feature(geometry=point, properties=eigenschaften)
                features.append(feature)

            except Exception as e:
                # Fehler-Logging
                print(f"  -> FEHLER bei Ladesäule mit Index {indice}: {e}")
                fehler_info = { 'index': indice, 'betreiber': row.get('Betreiber', 'N/A'), 'fehler_meldung': str(e) }
                fehlerhafte_zeilen.append(fehler_info)

            # Checkpoint-Speicherung
            if (len(features)) % 500 == 0 and len(features) > 0:
                print(f"\n--- CHECKPOINT: Speichere {len(features)} Features in {checkpoint_datei} ---\n")
                with open(checkpoint_datei, 'w') as f:
                    json.dump(features, f)

    finally:
        # --- 3. FINALE SPEICHERUNG ---
        print("\n----------------------------------------------------")
        print("Schleife beendet oder unterbrochen. Erstelle finale Dateien...")

        feature_collection = FeatureCollection(features)
        with open(finale_geojson_datei, 'w') as f:
            dump(feature_collection, f, indent=2)
        print(f"Finale GeoJSON-Datei mit {len(features)} Features gespeichert.")

        if fehlerhafte_zeilen:
            print(f"Speichere {len(fehlerhafte_zeilen)} fehlerhafte Zeilen im Log...")
            with open(fehler_log_datei, 'w', encoding='utf-8') as f:
                json.dump(fehlerhafte_zeilen, f, indent=2, ensure_ascii=False)
            print(f"Fehler-Log gespeichert unter: {fehler_log_datei}")
        else:
            print("Keine Fehler während des Laufs protokolliert.")

else:
    # Dieser Teil wird ausgeführt, wenn nach dem Laden des Checkpoints nichts mehr zu tun ist
    print("Alle Features wurden bereits verarbeitet. Erstelle finale GeoJSON-Datei...")
    feature_collection = FeatureCollection(features)
    with open(finale_geojson_datei, 'w') as f:
        dump(feature_collection, f, indent=2)
    print(f"Finale GeoJSON-Datei mit {len(features)} Features gespeichert!")

